    public static readonly IReadOnlyDictionary<string, IReadOnlyDictionary<string, PropDef>> PropsByType = BuildPropsByType();

    private static IReadOnlyDictionary<string, IReadOnlyDictionary<string, PropDef>> BuildPropsByType()
    {
        var map = new Dictionary<string, IReadOnlyDictionary<string, PropDef>>(StringComparer.OrdinalIgnoreCase);
        var buckets = new Dictionary<string, Dictionary<string, PropDef>>(StringComparer.OrdinalIgnoreCase);

        foreach (var def in All)
        {
            if (!buckets.TryGetValue(def.TypeName, out var byProp))
            {
                byProp = new Dictionary<string, PropDef>(StringComparer.OrdinalIgnoreCase);
                buckets[def.TypeName] = byProp;
            }

            byProp[def.SmlName] = def;
        }

        foreach (var entry in buckets)
        {
            map[entry.Key] = entry.Value;
        }

        return map;
    }
